package main

func Bf(planet1, planet2 string) []string {
    planets := []string{"Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"}

    // Find indices of the provided planets
    index1, index2 := -1, -1
    for i, planet := range planets {
        if planet == planet1 {
            index1 = i
        }
        if planet == planet2 {
            index2 = i
        }
    }

    // Check for invalid planet names
    if index1 == -1 || index2 == -1 {
        return []string{}
    }

    // Ensure index1 is less than index2
    if index1 > index2 {
        index1, index2 = index2, index1
    }

    // Collect planets between the two indices
    result := []string{}
    for i := index1 + 1; i < index2; i++ {
        result = append(result, planets[i])
    }

    return result
}
